import { Axios } from 'axios';
import React, {useEffect,useState} from 'react'


function Login() {
  const [loginLogin,Login]=useState("");
  const [loginPassword,Password]=useState("");


  const loginToAccount = ()=>
  {
    Axios.post("http://localhost:5000/api/loginToAccount",
    {
      loginLogin : loginLogin,
      loginPassword : loginPassword,
    })
  };
  return (
    <div className='center'>
    <div className='homeClass'> <h3>Logowanie</h3>
      <div className='form-group'>
    <label>Login :</label>
    <input type="text" name="loginLogin" placeholder="Podaj login" onChange={(e=>{Login(e.target.value)})}>

    </input>
    </div>
    <div className='form-group'>
    <label>Hasło :</label>
    <input type="password" name="loginPassword"  placeholder="Podaj hasło" onChange={(e=>{Password(e.target.value)})}>

    </input>
    </div>
    <button type="submit" class="btn btn-primary" onClick={loginToAccount}>Zaloguj</button>
    </div>
  </div>
  )
}

export default Login
